  \"2016-07-27T22:40:11.217093\",\n\t\"name\": \"klamath-marsh-national-wildlife-refuge-final-comprehensive-conservation-plan-and-environme\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Klamath Marsh NWR for the next 15 years. This
  plan outlines the Refuge vision and purpose and describes how Klamath Marsh NWR
  will contribute to the overall mission of the Refuge System. The plan provides an
  introduction to the Refuge, an overview of the CCP process, a summary of Refuge
  resources, information about the management direction, and strategies for implementation
  and monitoring. Key planning issues include: control of invasive species, fire management,
  visitor services, cultural resources, climate change, wetland management, forest
  management, land acquisition, Clearwinged grasshoppers, and threatened and endangered
  species.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
